<!DOCTYPE html>

<head>
    <title>Eden - Parallax Demo</title>
    <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.1.1/jquery.min.js"></script>
    <script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/gsap/1.17.0/TweenMax.min.js"></script>
    <script src="https://unpkg.com/popper.js@1"></script>
    <script src="https://unpkg.com/tippy.js@5"></script>
    <link rel="stylesheet" href="https://unpkg.com/tippy.js@5/dist/backdrop.css" />
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/tippy.js/2.5.3/themes/light.css" />
    <script>
        $.fn.parallax = function (resistance, mouse) {
            $el = $(this);
            TweenLite.to($el, 0.3, {
                x: -((mouse.clientX - window.innerWidth / 2) / resistance),
                y: -((mouse.clientY - window.innerHeight / 2) / resistance)
            });
        };

        $(document).mousemove(function (e) {
            $(".images--01").parallax(60, e);
            $(".images--02").parallax(70, e);
            $(".images--03").parallax(80, e);
            $(".images--04").parallax(90, e);
            $(".images--05").parallax(100, e);
            $(".images--06").parallax(110, e);

        });

        // Ready functions
        $(function () {
            // Enable tooltip
            tippy('[data-tippy-content]', { followCursor: true });

            // click listner, can also add anchor tags around image
            $('.images--overlay > div').on('click', function () {
                var elem = $(this);
                var elemTitle = $(elem).attr("data-tippy-content");

                // Update content in a small box, showing details of the items clicked
                var info = `<h3>Hey! You've clicked on ${elemTitle}</h3>
                <a href="https://twitter.com/edngibson" target="_blank">Click here to view my twitter</a>`;

                var infoContainer = $(".info-container");
                // Add content
                infoContainer.html(info);
                // Show info container
                infoContainer.fadeIn();
            });
        })

    </script>

    <style>
        /*Reset CSS*/
        * {
            margin: 0;
            padding: 0;
            /* background: #333333; */
        }

        /*
        Inline styling so can be on the same page
        */
        .parallax {
            width: 1080px;
            margin: auto;
        }

        .images--base,
        .images--overlay,
        .images--overlay>div {
            position: absolute;
        }

        /*Sorting and positioning*/
        .images--overlay>div {
            transform-origin: 0 0;
            cursor: pointer;
        }

        .floor {
            top: 757px;
        }

        .floorbox {
            top: 805px;
            left: 438px;
        }

        .occludingbox {
            top: 680px;
            left: 421px
        }

        .person {
            top: 541px;
            left: 471px;
        }

        .topbox {
            top: 0;
            left: 436px;
        }

        .trees {
            top: 70px;
            left: 0;
        }

        /*Z-indexes*/
        .z-index--1 {
            z-index: 1
        }

        .z-index--2 {
            z-index: 2
        }

        .z-index--3 {
            z-index: 3
        }

        .z-index--4 {
            z-index: 4
        }

        .z-index--5 {
            z-index: 5
        }

        .z-index--6 {
            z-index: 6
        }

        /*Info container*/
        .info-container {
            position: absolute;
            bottom: 0px;
            left: 100px;
            width: 200px;
            padding: 25px;
            border: 2px solid grey;
            border-radius: 5px;
            box-shadow: 0 0 5px 0 black;
            z-index: 9;
            background: white;
            color: #333333;
            text-align: center;
            display: flex;
            align-items: center;
            flex-direction: column;
        }

        .info-container a {
            padding: 10px 0;
        }
    </style>
</head>
